import './App.css';

function App() {

  const atividades = [
    {
      "id": 1,
      "descricao": "Primeira Atividade"
    }

  ]

  return (
    <div className="App">
      <header className="App-header">
        <ul className="list-group">
          <li className="list-group-item">{atividades[0].id} {atividades[0].descricao}</li>
          <li className="list-group-item">Segunda Atividade</li>
          <li className="list-group-item">Terceira Atividade</li>
          <li className="list-group-item">Quarta Atividade</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
